import { Component, OnInit } from '@angular/core';
import { Router } from '@angular/router';
import { user } from '../../models/user.model';
import { UsersService } from '../../Service/Users/users.service';

@Component({
  selector: 'app-sign-in',
  templateUrl: './sign-in.component.html',
  styleUrls: ['./sign-in.component.scss'],
  providers: [UsersService]

})
export class SignInComponent implements OnInit {

  //struct
  addUserRequest: user = {
    id: '',
    email: '',
    password: '',
    name: '',
    lastName:'',
    admin: false
  }
  constructor(private userService: UsersService, private router: Router) { }


  ngOnInit(): void { }

  addUser() {//add user
    this.addUserRequest.id = '00000000-0000-0000-0000-000000000000';//diffalt id
    this.userService.addUser(this.addUserRequest).subscribe({//add user by server
      next: (user) => {
        this.router.navigate(['log-In']);//route to log in
      },
      error: (respose) => {
        console.log(respose)
      }
    })
  }
}
<div class="row">
  <div class="col-6">
    <form #form="ngForm" (ngSubmit)="addUser()">
      <div class="mb-3">
        <label for="email" class="form-label">email</label>
        <input type="text" class="form-text" id="email"
               name="email" [(ngModel)]="addUserRequest.email">
      </div>
      <div class="mb-3">
        <label for="password" class="form-label">password</label>
        <input type="text" class="form-text" id="password"
               name="password" [(ngModel)]="addUserRequest.password">
      </div>
      <div class="mb-3">
        <label for="name" class="form-label">name</label>
        <input type="text" class="form-text" id="name"
               name="name" [(ngModel)]="addUserRequest.name">
      </div>
      <div class="mb-3">
        <label for="lastName" class="form-label">lastName</label>
        <input type="text" class="form-text" id="lastName"
               name="lastName" [(ngModel)]="addUserRequest.lastName">
      </div>
      <div class="mb-3">
        <label for="phone" class="form-label">phone</label>
        <input type="text" class="form-text" id="phone"
               name="phone" [(ngModel)]="addUserRequest.phone">
      </div>
      <button type="submit" class="btn btn-primary">Submit</button>
    </form>
  </div>
</div>
